import "./auth.css"
import { useState } from "react";
import { initializeApp } from "firebase/app";
import { createUserWithEmailAndPassword, getAuth } from "firebase/auth";
import { Link,useNavigate} from "react-router-dom";


function Signup() {

    const [name, setName] = useState("")
    const [email, setEmail] = useState("")
    const [pswd, setPswd] = useState("")
    const [cpswd, setCpswd] = useState("")

    const navigate=useNavigate()


    const firebaseConfig = {
        apiKey: "AIzaSyDAm1l6txCkIKB3EQsvt-L-6qgluOJpfhI",
        authDomain: "auth-cc868.firebaseapp.com",
        projectId: "auth-cc868",
        storageBucket: "auth-cc868.appspot.com",
        messagingSenderId: "431111410332",
        appId: "1:431111410332:web:38ab3e03f6c3777f631359",
        measurementId: "G-GV6YBQQM6B"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()

const ps=document.getElementById("ps")
    const submit = (event) => {
        event.preventDefault()

        const pattern=/^[a-z]+[0-9]+[\!@#$%^&*]$/
        if(pattern.test(pswd)){
            alert("dfgh")
        }
        // if (pswd != cpswd) {
        //     alert("password does not match...")
        // }
        else{
            ps.textContent="error"
        }
      
        let obj = {
            email: email,
            password: pswd
        }
        createUserWithEmailAndPassword(auth, obj.email, obj.password)

            .then(() => {
                alert("successfully register...")
                navigate("/login")
            })
            .catch(() => {
                alert("error...")
            })
    }


    return (

        <div className="container my-5 " style={{ width: "380px" }}>
            <div className="card p-4">
                <div className="card-title">
                    <h3 className="text-center">Create account</h3>
                </div>

                <div card-body>
                    <form onSubmit={submit}>  

                        {/* <div class="mb-3"> */}
                            <label class="form-label">Name</label>
                            <input value={name} type="text" onChange={e => setName(e.target.value)} required class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                            <span id=""></span>
                        {/* </div> */}
                        {/* <div class="mb-3"> */}
                            <label class="form-label">Email </label>
                            <input value={email} type="email" onChange={e => setEmail(e.target.value)} required class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                        {/* </div> */}
                        {/* <div class="mb-3"> */}
                            <label class="form-label">Password</label>
                            <input value={pswd} type="password" onChange={e => setPswd(e.target.value)} required class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" /><br/><span id="ps"></span>
                            <br/>
                          
                        {/* </div> */}

                        {/* <div class="mb-3"> */}
                            <label class="form-label">Confirm Password</label>
                            <input value={cpswd} type="password" onChange={e => setCpswd(e.target.value)} required class="form-control" id="exampleInputPassword1" aria-describedby="emailHelp" />
                        {/* </div> */}

                        <button type="submit " class="btn btn-primary">Submit</button>

                    </form>

                    <div>
                        <p className="para">if you have already account
                            <Link to='/login' id="link"> Login</Link> here
                        </p>
                    </div>


                </div>


            </div>


        </div>

    )
}
export default Signup;
